     , (16892, 13 /* QuestFailure_EmoteCategory */, 0, 0, 10 /* Tell_EmoteType */, 1, 1, NULL, 'I have the latest reports from the Arcanum with me. Asheron stopped by the Arcanum workshops and gifted the Tinkers with knowledge of Yalaini transmutation magic. Using their new insights, the Tinkers have found the way to penetrate the Foundries from which these statues have come. If you seek out the Arcanum Tinker in the Consortium near Xarabydun, he will be able to tell you more!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
